script: |
  super -f text -I q3200.spq | sort > q3200.out

inputs:
  - name: q3200.spq
    data: |
      SELECT DISTINCT col2 / col1 + ( - col0 ) * 58 + 74 / - cor0.col1 AS col1 FROM tab1 (FORMAT parquet) AS cor0;
  - name: tab1

outputs:
  - name: q3200.out
    data: |
      -174
      -3714
      -4638
